CREATE DEFINER=`hazem10`@`%` PROCEDURE `admin_login`(
IN p_id LONGTEXT,
IN p_company_id INT
)
BEGIN
    SELECT 
        au.user_name, 
        au.password, 
        au.admin_users_id,
        ap.* -- Select all columns from admin_privileges
    FROM 
        admin_users au
    JOIN 
        admin_privileges ap ON au.admin_users_id = ap.admin_users_id
    WHERE 
        (au.user_name = p_id OR au.email = p_id OR au.phone = p_id) 
        AND au.company_id = p_company_id;
END ;;
