CREATE DEFINER=`hazem10`@`%` PROCEDURE `get_available_date`(
IN p_restaurant_id VARCHAR(255),
IN p_hotel_id VARCHAR(255),
IN p_desired_date VARCHAR(255),
IN p_company_id VARCHAR(255)
)
back_door:BEGIN

DECLARE s_time_zone LONGTEXT;
SELECT time_zone INTO s_time_zone FROM hotels WHERE hotel_id = p_hotel_id;

SELECT 
DATE_FORMAT(CONVERT_TZ(time, '+00:00', s_time_zone),'%H:%i:%s') as time,
price,
per_person,
(SELECT currency_code FROM currencies fc WHERE fc.currencies_id = currency_id) as currency,
(SELECT exchange_rate FROM currencies fc WHERE fc.currencies_id = currency_id) as exchange_rate,
(SELECT currencies_id FROM currencies fc WHERE fc.currencies_id = currency_id) as currencies_id,
(SELECT get_available(p_company_id, p_hotel_id, p_restaurant_id, p_desired_date, time)) as remaining,
restaurant_pricing_times_id,
meal_type,
reservation_by_room
FROM restaurant_pricing_times rpt WHERE restaurant_id = p_restaurant_id AND concat(year,'-',month,'-',day) = p_desired_date AND company_id = p_company_id
AND CONVERT_TZ(STR_TO_DATE(CONCAT(year, '-', month, '-', day, ' ', time), '%Y-%m-%d %H:%i:%s'), '+00:00', (s_time_zone))  > CONVERT_TZ(NOW(), '+00:00', (s_time_zone)) ORDER BY time ASC;
END ;;
