CREATE DEFINER=`hazem10`@`%` PROCEDURE `get_confirm_qr`(
IN p_qrcode LONGTEXT
)
BEGIN

SELECT 
rs.room_number,
rs.pax,
(SELECT name FROM hotels WHERE hotel_id = rs.hotel_id) as name,
names,
(SELECT name FROM restaurants WHERE restaurants_id = rs.restaurant_id) as restaurant,
DATE_FORMAT(day, '%Y-%m-%d') as day,
DATE_FORMAT(CONVERT_TZ(time, '+00:00', (SELECT time_zone FROM hotels WHERE hotel_id = rs.hotel_id)),'%H:%i:%s') as time,
DATE_FORMAT(
CONVERT_TZ(created_at, '+00:00', (SELECT time_zone FROM hotels WHERE hotel_id = rs.hotel_id)),
'%Y-%m-%d %H:%i:%s'
) AS created_at,
(SELECT time_zone FROM hotels WHERE hotel_id = rs.hotel_id) as tz,
paid,
total_ammount,
price,
(SELECT currency_code FROM currencies WHERE currencies_id = rs.currencies_id) as currency,
(SELECT company_name FROM companies WHERE company_id = rs.company_id) as company_name,
(SELECT logo FROM companies WHERE company_id = rs.company_id) as logo
FROM reservations rs WHERE qrcode = p_qrcode;

END ;;
