CREATE DEFINER=`hazem10`@`%` PROCEDURE `get_pick_dates`(
IN p_guest_reservations_id VARCHAR(255),
IN p_hotel_id VARCHAR(255),
IN p_company_id VARCHAR(255)
)
BEGIN

DECLARE s_time_zone LONGTEXT;
SELECT time_zone INTO s_time_zone FROM hotels WHERE hotel_id = p_hotel_id;

SELECT 
	   DATE_FORMAT(CONVERT_TZ(DATE_ADD(NOW(), INTERVAL (SELECT plus_days_adjust FROM hotels WHERE hotel_id = p_hotel_id AND company_id = p_company_id) DAY),'+00:00', s_time_zone), '%Y-%m-%d') AS start_date,
	   DATE_FORMAT(CONVERT_TZ(DATE_SUB(departure_date, INTERVAL (SELECT minus_days_adjust FROM hotels WHERE hotel_id = p_hotel_id AND company_id = p_company_id) DAY),'+00:00', s_time_zone), '%Y-%m-%d') AS end_date,
       s_time_zone as tz
 FROM guest_reservations WHERE guest_reservations_id = p_guest_reservations_id;
END ;;
